import './App.css'
export default class App extends Component{
  state = {
    todos:[
      {id:'001',name:'学习'}
    ]
  } 
  render(){
    return (
      <div className="todo-container">
      <div className="todo-wrap">
        <Header/>
        <List/>
        <Footer/>
      </div>
    </div>
    )
  }
}
